import React, { Component } from "react";

class NavBar extends Component {
  render() {
    return (
      <nav className="navbar navbar-dark bg-dark">
        <span className="navbar-brand mlb-0 h1" style={{ color: "Lavender" }}>
          Mock Site
        </span>
      </nav>
    );
  }
}

export default NavBar;
